export default function App() {
  return (
    <div className="App">
      <div className="container">
        <CurrentWeather />
        <footer>
          <a href="https://github.com/Jkhweis/weather-app-react" target="blank">
            Open Source Code
          </a>
          by Joy Khweis
        </footer>
      </div>
    </div>
  );
}
